//获取当前产品的数据
var company =  getUrlParam('company');
var product = getUrlParam('product');
function getData(type){
	
	
	if(!product&&!company){
		alert('缺少参数');
	 	return;
	};
	var allJson = Json[company];
	if(allJson[product]&&allJson[product][type]){
	 	var iJson = allJson[product][type];
		 //暴露数据
		 if(iJson.globalConfig.panourl){
			iJson.globalConfig.panourl = iJson.globalConfig.panourl+'&company='+company;
		 }
		
		 if(type == 'ring'){
			if(!isNaN(iJson.imgList)){
				iJson.imgList = function(){
					var imgList = [];
					if(iJson.imgList>0){
					   for (var i=1;i<=iJson.imgList;i++) {
						   imgList.push('images/'+product+'/'+i+'.png?t='+(new Date().getTime()));   	
					   }
					}else{
					   for (var i=iJson.imgList;i>=1;i--) {
						   imgList.push('images/'+product+'/'+i+'.png?t='+(new Date().getTime()));   	
					   }
					}
					return imgList;
				}();
			 }
		 }
		window.jsonData =  iJson;
	}else{
	 	location.href='../index.html';
	}
}